// Utility functions for date calculations
const calculateYearsOfService = (hireDate: string, referenceDate: Date = new Date(2025, 11, 31)): number => {
  const hire = new Date(hireDate);
  const years = referenceDate.getFullYear() - hire.getFullYear();
  const monthDiff = referenceDate.getMonth() - hire.getMonth();
  const dayDiff = referenceDate.getDate() - hire.getDate();
  
  // Adjust if the anniversary hasn't occurred yet this year
  if (monthDiff < 0 || (monthDiff === 0 && dayDiff < 0)) {
    return years - 1;
  }
  return years;
};

const formatDate = (date: Date): string => {
  return date.toLocaleDateString('es-MX', {
    year: 'numeric',
    month: '2-digit',
    day: '2-digit'
  });
};

const getCurrentPrintDate = (): string => {
  return formatDate(new Date());
};

